import React from 'react'
import './Collage.css';
import { Images } from './Images';
const Collage = (props) => {
  return (
    <div className='collage'>
        {props.images.map((image)=>(
             <div>
                <img  src={image.urls.small} alt='photo'></img>
              </div>
           ))}
    </div>
  )
}

export default Collage
